import { Fragment } from "react";



const App = () => {

  const arak = [
    ["Halberd", "400gp"]   
  ]

  return (
    <section 
      style={{
      display: "flex",
      width: "100vw",
      height: "100vh",
      justifyContent: "center",
      alignItems: "center"
    }}>
      <button>Arak</button>
      <button>Osaris</button>
      <button>Garrogat</button>

      {arak.map((item, i) => {
        return (
          <>
        <p>{item}</p>
        </>
        )
      })}
    </section>
  )
}

export default App;
